import React, { useState } from 'react';
import axios from 'axios';
import logo from './logo.svg';
import './App.css';

function App() {

  const [formData, setFormData] = useState({
    url: '',
    firstName: '',
    lastName: '',
    sourceFind: '',
    prevEmployed: '',
    countryFrom: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:3001/submit-workday', formData);
      alert('Starting to fill application');
    } catch (error) {
      console.error('Error:', error);
      alert('An error occurred. Please try again.');
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to E-day, Were here to simplify Workday Job Applications
        </p>
        <h1>Submit Form</h1>
      <form onSubmit={handleSubmit}>
      <label>
          Job Source:
          <input
            type="text"
            name="sourceFind"
            value={formData.sourceFind}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Previously employed:
          <input
            type="text"
            name="prevEmployed"
            value={formData.prevEmployed}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          URL:
          <input
            type="text"
            name="url"
            value={formData.url}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          First Name:
          <input
            type="text"
            name="firstName"
            value={formData.firstName}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Last Name:
          <input
            type="text"
            name="lastName"
            value={formData.lastName}
            onChange={handleChange}
          />
        </label>
        <br />
        {/* Add other form fields here */}
        <br />
        <button type="submit">Submit</button>
      </form>
      </header>
    </div>
  );
}

export default App;
